  true,\n\t\"url\": null,\n\t\"notes\": \"<p>On November 5, 2009, President Obama
  signed an Executive Memorandum reaffirming the government-to-government relationship
  between Indian tribes and the Federal Government, and directing each executive department
  and agency to consult with tribal governments prior to taking actions that affect
  this population. The importance of consultation with Indian tribes was affirmed
  through Presidential Memoranda in 1994, 2004, and 2009, and Executive Order 13175
  in 2000.  The purpose of the ACF Tribal Consultation Policy is to build meaningful
  relationships with federally recognized tribes by engaging in open, continuous,
  and meaningful consultation.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
